// **************Sound_Init*********************
// Initialize digital outputs and SysTick timer
// Called once, with sound/interrupts initially off
// Input: none
// Output: none 
void Sound_Init(void){
	
	DAC_Init();
	//SYSCTL_RCGCGPIO_R |= 0x12;
	//volatile unsigned long delay;
	//delay = SYSCTL_RCGCGPIO_R;
	
	NVIC_ST_CTRL_R = 0;         																 // disable SysTick during setup
  NVIC_ST_RELOAD_R = 0xFFFFFFFF;															 // reload value
														 // reload value	
  NVIC_ST_CURRENT_R = 0;      															 // any write to current clears it
  NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x20000000; // Sets to Priority one
  NVIC_ST_CTRL_R = 0xFFFF; 
	
	//Defines Timer Reload Value to cause a freq --> 11.025 kHz
  #define timer_freq (80000000/11025)
//	Timer0_Init(timer_freq); //What should this be for 11 KHz
//	Index = 0;										//Sound Index = 0
}


static uint32_t i = 0;


void SysTick_Handler(void){
	GPIO_PORTE_DATA_R |= 0x08;
  i = (i+1)%(32);
  DAC_Out(wave[i]);
	GPIO_PORTE_DATA_R &= ~0x08;

	//TIMER0_ICR_R = TIMER_ICR_TATOCINT; // acknowledge TIMER0A timeout

}


// **************Sound_Play*********************
// Start sound output, and set Systick interrupt period 
// Sound continues until Sound_Play called again
// This function returns right away and sound is produced using a periodic interrupt
// Input: interrupt period
//           Units of period to be determined by YOU
//           Maximum period to be determined by YOU
//           Minimum period to be determined by YOU
//         if period equals zero, disable sound output
// Output: none
void Sound_Play(uint32_t period){
	
	if(period == 0){
		NVIC_ST_RELOAD_R = 0;
	}else{
		NVIC_ST_RELOAD_R = period-1;
	}
	
}



